import{_ as e}from"./chunks/overview.BlLt59Fq.js";import{_ as t}from"./chunks/overview.Os_4-tdv.js";import{_ as a}from"./chunks/overview.CVFRh3NM.js";import{_ as o,c as n,o as r,a4 as i}from"./chunks/framework.uQk9_EO2.js";const s="/docs/cocos/assets/enable.DoT6evjk.png",l="/docs/cocos/assets/overview.BvZ11mTC.png",c="/docs/cocos/assets/menu.DALu0d7R.png",A="/docs/cocos/assets/close-alert.DJ3PHmSs.png",d="data:image/png;base64,",p="/docs/cocos/assets/publish.D5MFk5wl.png",O=JSON.parse('{"title":"Localization","description":"","frontmatter":{},"headers":[],"relativePath":"en/editor/l10n/overview.md","filePath":"en/editor/l10n/overview.md","lastUpdated":1712305443000}'),u={name:"en/editor/l10n/overview.md"},h=i('<h1 id="localization" tabindex="-1">Localization <a class="header-anchor" href="#localization" aria-label="Permalink to &quot;Localization&quot;">​</a></h1><p>Localization (hereinafter referred to as L10N) is a feature introduced in Cocos Creator 3.6 that integrates translation services from third-party translation service providers, while running the localization of text, audio and image resources into the engine and supporting one-click publishing to different languages.</p><blockquote><p>L10N is the abbreviation of the first and last letter of the word Localization, 10 means Localization with 10 letters in the middle.</p></blockquote><h2 id="l10n-overview" tabindex="-1">L10N OverView <a class="header-anchor" href="#l10n-overview" aria-label="Permalink to &quot;L10N OverView&quot;">​</a></h2><p>The Localization Editor panel can be opened by selecting <strong>Panel</strong> -&gt; <strong>Localization Editor</strong> in the top menu of the engine. <br></p><p>At first start-up, the user has to manually enable the L10N function.</p><p><img src="'+s+'" alt="enable"></p><p>You can edit it after starting it.</p><p><img src="'+l+'" alt="overview"></p><p>In the upper right corner of the panel, the L10N provides two functions <strong>Turn Off L10N</strong> and <strong>Unload Data</strong>.</p><p><img src="'+c+'" alt="menu"></p><ul><li><p><strong>Turn Off L10N</strong>: Disable the L10N function. After selecting Confirm in the secondary menu that pops up, the data is still retained and the developer can enable the function again:</p><p><img src="'+A+'" alt="alert"></p></li><li><p><strong>Unload data</strong>: After selecting Confirm in the popup secondary menu, the L10N data will be cleared and the associated components in the scene will be deleted:</p><p><img src="'+d+'" alt="alert"></p><blockquote><p><strong>Note</strong>: The uninstalled data cannot be recovered, please operate with caution.</p></blockquote></li></ul><h2 id="translation-service-provider" tabindex="-1">Translation Service Provider <a class="header-anchor" href="#translation-service-provider" aria-label="Permalink to &quot;Translation Service Provider&quot;">​</a></h2><p><img src="'+e+'" alt="overview"></p><p>The engine integrates the translation services of several translation service providers, and developers can choose different translation service providers to provide more complete and diversified services. For details, please refer to <a href="./translation-service">Translation Service Provider</a>.</p><h2 id="collect-and-count" tabindex="-1">Collect and Count <a class="header-anchor" href="#collect-and-count" aria-label="Permalink to &quot;Collect and Count&quot;">​</a></h2><p><img src="'+t+'" alt="ovefview"></p><p>Collect and count collects resources that may need to be translated in a project to facilitate translation, and developers can also filter them by specifying specific files, directories, or through configuration. For details, please refer to <a href="./collect-and-count">Collect and Count</a></p><h2 id="compile-language" tabindex="-1">Compile Language <a class="header-anchor" href="#compile-language" aria-label="Permalink to &quot;Compile Language&quot;">​</a></h2><p><img src="'+a+'" alt="overview"></p><p>Language translation allows you to view the currently configured and translated languages and view their progress or delete actions. Manual processing of certain non-text resources is also provided. For more details, please refer to <a href="./compile-language">Compile Language</a></p><h2 id="programming-guide" tabindex="-1">Programming Guide <a class="header-anchor" href="#programming-guide" aria-label="Permalink to &quot;Programming Guide&quot;">​</a></h2><p>Please refer to <a href="./script-using">Sample</a> for an example of programmatic use of L10N.</p><h2 id="publish" tabindex="-1">Publish <a class="header-anchor" href="#publish" aria-label="Permalink to &quot;Publish&quot;">​</a></h2><p>Once the translation has been completed according to the above steps, it can be published with one click on the build panel at</p><p><img src="'+p+'" alt="publish"></p><ul><li><strong>Language used</strong>: This will contain all the languages set in the <strong>Localization Editor</strong>, and developers can select them as needed depending on the version</li><li><strong>Default language</strong>: the language used when the project is started after the release</li><li><strong>Alternate language</strong>: the alternate language to be used if there is a problem with the default language</li></ul><h2 id="q-a" tabindex="-1">Q &amp; A <a class="header-anchor" href="#q-a" aria-label="Permalink to &quot;Q &amp; A&quot;">​</a></h2><ul><li>Q: Is there a solution if I accidentally modify the data file and the data file becomes corrupted and I cannot open L10N? A: You can modify it by searching the corresponding file in &quot;{project directory}\\localization-editor\\translate-data&quot;.</li></ul>',29),f=[h];function g(m,v,b,q,C,L){return r(),n("div",null,f)}const x=o(u,[["render",g]]);export{O as __pageData,x as default};
